# encoding: utf8
'''
Surrounded Regions
Given a 2D board containing 'X' and 'O', capture all regions surrounded by 'X'.

A region is captured by flipping all 'O's into 'X's in that surrounded region.

For example,
X X X X
X O O X
X X O X
X O X X
After running your function, the board should be:

X X X X
X X X X
X X X X
X O X X

先把所有O变成x，然后从边界开始，把所有的x(包括联通的)变回O，最后，把x变成X。
但是当地图太大是，会RuntimeError: maximum recursion depth exceeded in cmp。递归层数太多。
DFS改为BFS应该可以解决问题。
'''

import unittest
from pprint import pprint
import pdb

class Solution:
    # @param {character[][]} board
    # @return {void} Do not return anything, modify board in-place instead.
    def solve(self, board):
        self.l1=l1=len(board)
        if l1==0:
            return
        self.l2=l2=len(board[0])

        bb=[]
        for i in range(l1):
            tmp=[]
            for j in range(l2):
                tmp.append(board[i][j])
            bb.append(tmp)
        self.board=bb

        # 先把所有O变成x
        for i in range(l1):
            for j in range(l2):
                if bb[i][j]=='O':
                    self.to_x(i,j,'x','O')
        # 再把边缘的x变回O
        for i in range(l1):
            if bb[i][0]=='x':
                self.to_x(i,0,'O','x')
            if bb[i][l2-1]=='x':
                self.to_x(i,l2-1,'O','x')
        for j in range(l2):
            if bb[0][j]=='x':
                self.to_x(0,j,'O','x')
            if bb[l1-1][j]=='x':
                self.to_x(l1-1,j,'O','x')
        # 最后，把x变成X
        for i in range(l1):
            for j in range(l2):
                if bb[i][j]=='x':
                    bb[i][j]='X'

        for i in range(l1):
            board[i]=''.join(bb[i])

    def to_x(self, x, y, char, char_ori):
        direction=[[1,0],[-1,0],[0,1],[0,-1]]
        self.board[x][y]=char
        for d in range(4):
            xx=x+direction[d][0]
            yy=y+direction[d][1]
            if 0<=xx<self.l1 and 0<=yy<self.l2 and self.board[xx][yy]==char_ori:
                self.to_x(xx,yy,char,char_ori)


class testCase(unittest.TestCase):
    def setUp(self):
        pass
        self.a=Solution()

    def testLeet(self):
        a=[
            ['X','X','X','X'],
            ['X','O','O','X'],
            ['X','X','O','X'],
            ['X','O','X','X']]
        pprint(a)
        self.a.solve(a)
        pprint(a)
